INSERT INTO `selecao` (`codigo`, `sigla`, `chave`, `nome`, `continente`, `foto`, `fototime`, `descricao`) VALUES
	(1, 'BR', 'A', 'Brasil', 'América do Sul', '../brasoes/CBF.png', '../fototime/brasil.jpg', 'A Seleção Brasileira de Futebol é o time nacional do Brasil de futebol masculino, gerido pela Confederação Brasileira de Futebol (CBF), que representa o país nas competições de futebol organizadas pela CONMEBOL e pela FIFA. É o time mais bem-sucedido de futebol na história das Copas do Mundo, sendo a seleção nacional que mais vezes conquistou o Mundial com cinco títulos até então (1958, 1962, 1970, 1994, 2002). Tendo conquistado um total de 72 títulos internacionais oficiais a nível profissional e de seleções de base, sendo um recorde mundial. Um lema comum da seleção nacional do Brasil é: Os ingleses o inventaram, mas os brasileiros o aperfeiçoaram. O Brasil é consistente entre as nações mais fortes de futebol do planeta e é a única equipe a ter jogado em todas as copas do mundo.'),
	(2, 'IT', 'A', 'Italia', 'Europa', '../brasoes/Italia.png', '../fototime/italia.jpg', 'A Seleção Italiana de Futebol é a segunda mais bem sucedida seleção de futebol em Copas do Mundo, tendo saído vitoriosa em quatro. Venceu também uma Eurocopa e ganhou uma medalha olímpica de ouro. A cor tradicional da camisa da seleção é em homenagem à antiga casa real italiana de Saboia, cuja família reinou o país de 1861 até 1946 e tinha como o brasão imperial a cor predominante azul claro (azzurro em italiano) e, portanto, os membros da seleção são apelidados Azzurri e a seleção, de Squadra Azzurra. Os calções são tradicionalmente brancos, e tradicionalmente também a combinação contrária (camisas e meias brancas e calções azuis) constituem o uniforme reserva. Uma triste lembrança em meio ao título na Copa do Mundo de 1938, entretanto, foi em relação ao segundo uniforme utilizado: totalmente preto, a cor do fascismo, tendo sido utilizado nas semifinais contra os anfitriões franceses. Calções pretos também foram utilizados na Copa do Mundo de 1966, no jogo contra a União Soviética.'),
	(3, 'JP', 'A', 'Japao', 'Asia', '../brasoes/Japao.png', '../fototime/japao.jpg', 'A Seleção Japonesa de Futebol representa o Japão nas competições de futebol da FIFA. É filiada à instituição desde 1920. Já disputaram quatro Copas do Mundo, sendo uma das mais bem sucedidas seleções asiáticas dos últimos tempos. O primeiro resultado expressivo da seleção japonesa foi a medalha de bronze nas Olimpíadas de 1968. Entretanto, o país não contava com uma liga profissional e o esporte mais popular era o beisebol; acumulando resultados negativos por um longo período. Entretanto, este panorama começou a mudar com a profissionalização do futebol e a criação da J-League em meados da década de 1990. O primeiro grande resultado foi a conquista da Copa da Ásia em 1992. A melhora também foi sentida nas Eliminatórias para a Copa do Mundo de 1994, onde o Japão só foi eliminado na última rodada. O grande feito fica por conta da classificação para a Copa do Mundo de 1998, a primeira de sua história.'),
	(4, 'MX', 'A', 'Mexico', 'América do Sul', '../brasoes/Mexico.png', '../fototime/mexico.jpg', 'A Seleção Mexicana de Futebol representa o México no futebol e é regido pela Federação Mexicana de Futebol (FMF), o órgão regulador do futebol no México. O estádio de casa do México é o Estádio Azteca e seu treinador é José Manuel de la Torre. A equipe é atualmente a 20ª no Ranking Mundial da FIFA e 12ª no Ranking Mundial Elo. O México se classificou para quatorze Copas do Mundo e se classificou consecutivamente desde 1994; México jogou contra a França no primeiro jogo da primeira Copa do Mundo em 13 de Julho de 1930. A melhor progressão do México é ter chegado às quartas-de-final nas Copas de 1970 e 1986, sendo que ambas foram disputadas em solo mexicano. O México é, historicamente, a equipe de maior sucesso nacional na região da CONCACAF, pois eles são a única seleção da região a ganhar um título oficial reconhecido da FIFA. Eles detêm uma medalha de ouro olímpica, uma Copa das Confederações, nove campeonatos da CONCACAF, incluindo seis Copas Ouro da CONCACAF, uma Copa das Nações da América do Norte e dois Campeonatos NAFC. Embora o México esteja sob a jurisdição da CONCACAF, a equipe de futebol nacional tem sido regularmente convidada para competir na Copa América desde a do Equador em 1993, terminando como vice-campeão duas vezes e obtendo a medalha de terceiro lugar em três ocasiões.'),
	(5, 'ES', 'B', 'Espanha', 'Europa', '../brasoes/Espanha.png', '../fototime/espanha.jpg', 'A Seleção Espanhola de Futebol, gerida pela Real Federação Espanhola de Futebol, representa a Espanha nas competições de futebol da UEFA e FIFA. Em Jogos Olímpicos, o maior êxito da Espanha ocorreu em 1992, quando foi ganha a medalha de ouro, em Jogos sediados em Barcelona. A Seleção Espanhola também já conseguiu duas medalhas de prata, em 1920 (Jogos de Antuérpia) e em 2000 (Jogos de Sydney). Participou de 13 edições da Copa do Mundo FIFA, sendo campeã da edição de 2010. Nesta Copa do Mundo, a Espanha quebrou um tabu: foi a primeira seleção que perdeu seu jogo de estreia (1 a 0 para a Suíça) e terminou campeã. É também a atual campeã da Eurocopa, vencendo a edição de 2012, além da edição de 1964 e 2008. \nAtualmente, é uma das melhores seleções de futebol do mundo, estando na 1ª colocação do Ranking da FIFA.'),
	(6, 'UY', 'B', 'Uruguai', 'América do Sul', '../brasoes/Uruguai.png', '../fototime/uruguai.jpg', 'A Seleção Uruguaia de Futebol, também conhecida como Celeste ou Celeste Olímpica2 , representa o Uruguai nas competições de futebol da CONMEBOL e FIFA. Possui uma das mais gloriosas histórias do futebol mundial, tendo conquistado um total de 21 títulos internacionais oficiais, sendo a seleção com mais títulos oficias no mundo. Foi a primeira seleção, junto à Argentina, a jogar uma partida internacional fora das Ilhas Britânicas, em 16 de maio de 1901 em Montevidéu. Seria conhecida como "A Celeste" desde seu primeiro triunfo em Montevidéu, em 15 de agosto de 1910 por 3 a 1, na primeira partida em que utilizou sua camiseta celeste, adotada como emblema nacional em reconhecimento ao triunfo que pouco antes havia conseguido o River uruguaio ante o poderoso Alumni portenho por 2 a 1 com essas mesmas cores.'),
	(7, 'NG', 'B', 'Nigeria', 'Africa', '../brasoes/Nigeria.png', '../fototime/nigeria.jpg', 'A Seleção Nigeriana de Futebol representa a Nigéria nas competições de futebol da CAF e FIFA. Conseguiram chegar à Copa do Mundo pela primeira vez na Copa do Mundo de 1994 e desde então apareceram mais duas vezes. Ainda não passaram das oitavas-de-final. A Nigéria ganhou a Copa das Nações Africanas três vezes, em 1980 e 1994, e 2013. Além disso, também ganharam a medalha de ouro nas Olimpíadas de 1996 (quando venceu o Brasil na semi-final e a Argentina na final). E também foi medalha de prata nas Olimpíadas de 2008, quando foi derrotado pela Seleção Argentina de Futebol na final. Nos Jogos Pan-Africanos, ganharam a medalha de ouro em 1973, duas de prata em 1978 e 2003 e duas de bronze em 1991 e 1995. No futebol feminino, ganhou duas medalhas de ouro nos Jogos Pan-Africanos em 2003 e 2007, sendo a atual campeã. As seleções de base da Nigéria ganharam o título do Campeonato Mundial de Futebol Sub-17 em 1985, 1993 e 2007. Ainda venceu a Copa das Nações Afro-Asiáticas e a Copa CEDEAO.'),
	(8, 'TA', 'B', 'Taiti', 'Oceania', '../brasoes/Taiti.png', '../fototime/taiti.jpg', 'A Seleção Taitiana de Futebol representa a Polinésia Francesa nas competições oficiais da FIFA. O arquipélago, até hoje uma dependência de ultramar da França, nunca disputou uma Copa do Mundo, mas obteve qualificação para a Copa do Mundo Sub-20 de 2009 no Egito, sendo o primeiro arquipélago da Oceania a competir em um torneio promovido pela FIFA. Recentemente fez história ao conquistar a Copa das Nações da OFC de 2012, tornando-se assim o primeiro time fora do eixo Austrália-Nova Zelândia a conquistar o torneio. A conquista foi ainda mais significativa, já que o Taiti ganhou com ela o direito de participar pela primeira vez da Copa das Confederações, a ser disputada em 2013 no Brasil. Desde que as seleções da Oceania participam do torneio, é a primeira vez que uma seleção diferente de Austrália e Nova Zelândia disputam o torneio. Em 2013, no Brasil, o Taiti enfrentará a atual campeã mundial Espanha, o campeão da América do Sul Uruguai e a Nigéria, campeã do Campeonato Africano das Nações de 2013. O time atualmente consiste em sua maioria de semi-profissionais que jogam nos dois maiores clubes da ilha, com apenas um jogando em tempo integral e fora do Taiti, Marama Vahirua, do grego Panthrakikos e com passagem de 14 anos no futebol francês (atuou por Nantes, Nice, Lorient, Nancy e Monaco), chegando a jogar pela Seleção sub-21 (marcou dois gols em seis jogos). O primo de Marama, Pascal Vahirua, embora seja taitiano de nascimento, preferiu jogar pela Seleção Francesa. A seleção também tem em seu elenco quatro jogadores que são parentes, todos da família Tehau: o volante Jonathan, o lateral-meia-atacante Alvin (ambos irmãos gêmeos) e os meia-atacantes Lorenzo e Teaonui (primos). Na Copa das Confederações em 2013, o Taiti fez história ao marcar o primeiro gol oficial da história da seleção fora do seu continente. O autor do gol foi Jonathan Tehau, no dia 17 de junho contra a Nigéria no Estádio Mineirão. A partida terminou 6 a 1 à favor da Nigéria.');
